import React from 'react';
import { BrowserRouter as Router, Routes, Route  } from 'react-router-dom';



import './App.css';

import { Login } from './pages/Login/login';

function App () {
  return(
    <>
    <Router>
      <Routes>
        <Route exact path="/" element={<Login/>} />

      </Routes>
    </Router>

    </>
  )
}

export default App;
